      <header className="App-header">
        <p>Simumlation 1, both counters in 1 err</p>
        <ErrorBoundary>
          <Counter/>
          <Counter/>
        </ErrorBoundary>
        <p>Simumlation 2, 1 counter in 1 err</p>
        <ErrorBoundary>
          <Counter/>
        </ErrorBoundary>
        <ErrorBoundary>
          <Counter/>
        </ErrorBoundary>
        <p>Simumlation 3, no err counter</p>
          <Counter/>

      </header>
    </div>
  );
}

export default App;
